import React, { Component } from 'react';

export class User extends Component {
  render() {
    return <div>
        <ul>
            <li>Name: {this.props.name}</li>
            <li>SurName:{this.props.surName}</li>
            <li>Salary:{this.props.salary}</li>
            <li>Depart:{this.props.department}</li>
        </ul>
    </div>;
  }
}

export default User;
